from sympy import isprime
def a(n, startfrom=1):
  an = startfrom + (1 - startfrom%2)
  while not all(isprime(int("9"*k+str(an))) for k in range(1, n+1)): an+=2
  return an
def afind(nn):
  an = 1
  for n in range(1, nn+1): an = a(n, startfrom=an); print(an, end=", ")
